import React from "react";

function Contact() {
    var hovered = document.querySelector("hover");
    var hover = false;

    if (hovered) {
        console.log(hovered.id);
    }
    if (hovered && hovered.id === "ul_type") {
        hover = true;
    }
    else {
        console.log("t nul");
        hover = false;
    }
    return (
        <div className="contact">
            <h1 id="ul_type">
                Contact
            </h1>
            <ul hidden={hover} id="ul_type">
                <li>
                    Mail
                </li>
                <li>
                    LinkedIn
                </li>
                <li>
                    Call
                </li>
            </ul>
        </div>
    );
}

export default Contact;
